import { Fragment } from "react";
import { BrowserRouter, Route, Routes, Navigate } from "react-router-dom";
import Home from '../pages/Home';

const RoutesApp = () => {
    return (
        <BrowserRouter>
            <Fragment>
                <Routes>
                    <Route path="/" element={<Home />} />
                </Routes>
            </Fragment>
        </BrowserRouter>
    )
}

export default RoutesApp
